INSERT INTO `wp_posts` VALUES (8,1,'2024-03-04 09:08:56','2024-03-04 08:08:56','<style>/*! elementor - v3.20.0 - 26-03-2024 */\n.elementor-heading-title{padding:0;margin:0;line-height:1}.elementor-widget-heading .elementor-heading-title[class*=elementor-size-]>a{color:inherit;font-size:inherit;line-height:inherit}.elementor-widget-heading .elementor-heading-title.elementor-size-small{font-size:15px}.elementor-widget-heading .elementor-heading-title.elementor-size-medium{font-size:19px}.elementor-widget-heading .elementor-heading-title.elementor-size-large{font-size:29px}.elementor-widget-heading .elementor-heading-title.elementor-size-xl{font-size:39px}.elementor-widget-heading .elementor-heading-title.elementor-size-xxl{font-size:59px}</style><h2>BOISSON ÉNERGISANTE</h2>		\n			<h2>100% NATURELLE</h2>		\n			<style>/*! elementor - v3.20.0 - 26-03-2024 */\n.elementor-widget-image{text-align:center}.elementor-widget-image a{display:inline-block}.elementor-widget-image a img[src$=\".svg\"]{width:48px}.elementor-widget-image img{vertical-align:middle;display:inline-block}</style>										<img width=\"387\" height=\"618\" src=\"http://planty.local/wp-content/uploads/2024/03/canette-planty.png\" alt=\"canette planty\" srcset=\"http://planty.local/wp-content/uploads/2024/03/canette-planty.png 387w, http://planty.local/wp-content/uploads/2024/03/canette-planty-188x300.png 188w\" sizes=\"(max-width: 387px) 100vw, 387px\" />													\n													<img width=\"350\" height=\"401\" src=\"http://planty.local/wp-content/uploads/2024/03/feuille-gauche.png\" alt=\"feuille gauche\" srcset=\"http://planty.local/wp-content/uploads/2024/03/feuille-gauche.png 350w, http://planty.local/wp-content/uploads/2024/03/feuille-gauche-262x300.png 262w\" sizes=\"(max-width: 350px) 100vw, 350px\" />													\n													<img width=\"350\" height=\"401\" src=\"http://planty.local/wp-content/uploads/2024/03/feuille-droite.png\" alt=\"feuille droite\" srcset=\"http://planty.local/wp-content/uploads/2024/03/feuille-droite.png 350w, http://planty.local/wp-content/uploads/2024/03/feuille-droite-262x300.png 262w\" sizes=\"(max-width: 350px) 100vw, 350px\" />													\n													<img width=\"387\" height=\"618\" src=\"http://planty.local/wp-content/uploads/2024/03/canette-planty.png\" alt=\"canette planty\" srcset=\"http://planty.local/wp-content/uploads/2024/03/canette-planty.png 387w, http://planty.local/wp-content/uploads/2024/03/canette-planty-188x300.png 188w\" sizes=\"(max-width: 387px) 100vw, 387px\" />													\n													<img width=\"350\" height=\"401\" src=\"http://planty.local/wp-content/uploads/2024/03/feuille-droite.png\" alt=\"feuille droite\" srcset=\"http://planty.local/wp-content/uploads/2024/03/feuille-droite.png 350w, http://planty.local/wp-content/uploads/2024/03/feuille-droite-262x300.png 262w\" sizes=\"(max-width: 350px) 100vw, 350px\" />													\n													<img width=\"350\" height=\"401\" src=\"http://planty.local/wp-content/uploads/2024/03/feuille-gauche.png\" alt=\"feuille gauche\" srcset=\"http://planty.local/wp-content/uploads/2024/03/feuille-gauche.png 350w, http://planty.local/wp-content/uploads/2024/03/feuille-gauche-262x300.png 262w\" sizes=\"(max-width: 350px) 100vw, 350px\" />													\n													<img width=\"350\" height=\"401\" src=\"http://planty.local/wp-content/uploads/2024/03/feuille-gauche.png\" alt=\"feuille gauche\" srcset=\"http://planty.local/wp-content/uploads/2024/03/feuille-gauche.png 350w, http://planty.local/wp-content/uploads/2024/03/feuille-gauche-262x300.png 262w\" sizes=\"(max-width: 350px) 100vw, 350px\" />													\n													<img width=\"387\" height=\"618\" src=\"http://planty.local/wp-content/uploads/2024/03/canette-planty.png\" alt=\"canette planty\" srcset=\"http://planty.local/wp-content/uploads/2024/03/canette-planty.png 387w, http://planty.local/wp-content/uploads/2024/03/canette-planty-188x300.png 188w\" sizes=\"(max-width: 387px) 100vw, 387px\" />													\n													<img width=\"350\" height=\"401\" src=\"http://planty.local/wp-content/uploads/2024/03/feuille-droite.png\" alt=\"feuille droite\" srcset=\"http://planty.local/wp-content/uploads/2024/03/feuille-droite.png 350w, http://planty.local/wp-content/uploads/2024/03/feuille-droite-262x300.png 262w\" sizes=\"(max-width: 350px) 100vw, 350px\" />													\n			<h2>L\'énergie des plantes</h2>		\n		<p> Planty, c’est la première boisson<br />énergisante composée à 100 % de produits naturels. <br />Avec son goût frais et fruité, retrouvez votre <br />énergie grâce aux plantes riches en vitamine B2, <br />à n’importe quel moment de la journée.</p>		\n			<h2>Les goûts</h2>		\n		<p>Nous avons une saveur pour chaque moment de votre journée.</p>		\n			<style>/*! elementor - v3.20.0 - 26-03-2024 */\n.elementor-image-gallery .gallery-item{display:inline-block;text-align:center;vertical-align:top;width:100%;max-width:100%;margin:0 auto}.elementor-image-gallery .gallery-item img{margin:0 auto}.elementor-image-gallery .gallery-item .gallery-caption{margin:0}.elementor-image-gallery figure img{display:block}.elementor-image-gallery figure figcaption{width:100%}.gallery-spacing-custom .elementor-image-gallery .gallery-icon{padding:0}@media (min-width:768px){.elementor-image-gallery .gallery-columns-2 .gallery-item{max-width:50%}.elementor-image-gallery .gallery-columns-3 .gallery-item{max-width:33.33%}.elementor-image-gallery .gallery-columns-4 .gallery-item{max-width:25%}.elementor-image-gallery .gallery-columns-5 .gallery-item{max-width:20%}.elementor-image-gallery .gallery-columns-6 .gallery-item{max-width:16.666%}.elementor-image-gallery .gallery-columns-7 .gallery-item{max-width:14.28%}.elementor-image-gallery .gallery-columns-8 .gallery-item{max-width:12.5%}.elementor-image-gallery .gallery-columns-9 .gallery-item{max-width:11.11%}.elementor-image-gallery .gallery-columns-10 .gallery-item{max-width:10%}}@media (min-width:480px) and (max-width:767px){.elementor-image-gallery .gallery.gallery-columns-2 .gallery-item,.elementor-image-gallery .gallery.gallery-columns-3 .gallery-item,.elementor-image-gallery .gallery.gallery-columns-4 .gallery-item,.elementor-image-gallery .gallery.gallery-columns-5 .gallery-item,.elementor-image-gallery .gallery.gallery-columns-6 .gallery-item,.elementor-image-gallery .gallery.gallery-columns-7 .gallery-item,.elementor-image-gallery .gallery.gallery-columns-8 .gallery-item,.elementor-image-gallery .gallery.gallery-columns-9 .gallery-item,.elementor-image-gallery .gallery.gallery-columns-10 .gallery-item{max-width:50%}}@media (max-width:479px){.elementor-image-gallery .gallery.gallery-columns-2 .gallery-item,.elementor-image-gallery .gallery.gallery-columns-3 .gallery-item,.elementor-image-gallery .gallery.gallery-columns-4 .gallery-item,.elementor-image-gallery .gallery.gallery-columns-5 .gallery-item,.elementor-image-gallery .gallery.gallery-columns-6 .gallery-item,.elementor-image-gallery .gallery.gallery-columns-7 .gallery-item,.elementor-image-gallery .gallery.gallery-columns-8 .gallery-item,.elementor-image-gallery .gallery.gallery-columns-9 .gallery-item,.elementor-image-gallery .gallery.gallery-columns-10 .gallery-item{max-width:100%}}</style>		\n			<figure class=\'gallery-item\'>\n				<img width=\"150\" height=\"100\" src=\"http://planty.local/wp-content/uploads/2024/03/Fraise-1.jpg\" alt=\"\" decoding=\"async\" />\n			</figure><figure class=\'gallery-item\'>\n				<img width=\"150\" height=\"100\" src=\"http://planty.local/wp-content/uploads/2024/03/Framboise-1.jpg\" alt=\"\" decoding=\"async\" />\n			</figure>\n			<figure class=\'gallery-item\'>\n				<img width=\"150\" height=\"100\" src=\"http://planty.local/wp-content/uploads/2024/03/Pamplemousse-1.jpg\" alt=\"\" decoding=\"async\" />\n			</figure><figure class=\'gallery-item\'>\n				<img width=\"150\" height=\"100\" src=\"http://planty.local/wp-content/uploads/2024/03/Citron-1.jpg\" alt=\"\" decoding=\"async\" />\n			</figure>\n			<h2>FRAISE</h2>		\n			<h2>FRAISE</h2>		\n			<h2>PAMPLE</h2>		\n			<h2>PAMPLE</h2>		\n			<h2>MOUSSE</h2>		\n			<h2>MOUSSE</h2>		\n			<h2>FRAM</h2>		\n			<h2>FRAM</h2>		\n			<h2>BOISE</h2>		\n			<h2>BOISE</h2>		\n			<h2>CITRON</h2>		\n			<h2>CITRON</h2>		\n			<a href=\"http://planty.local/commander/\">\n						Commander\n					</a>\n			<h2>Ce qu\'ils en pensent</h2>		\n													<img src=\"http://planty.local/wp-content/uploads/elementor/thumbs/Fathia-1-qllkp4qsqv5ogj9ypvzcwep9ooorj0qk1knsaqbram.jpg\" title=\"Fathia\" alt=\"Fathia\" loading=\"lazy\" />													\n			<h2>Fathia</h2>		\n		<p>La meilleure boisson énergisante disponible sur le marché !</p>		\n													<img src=\"http://planty.local/wp-content/uploads/elementor/thumbs/Vero-1-qllkp4qsqv5ogj9ypvzcwep9ooorj0qk1knsaqbram.jpg\" title=\"Véro\" alt=\"Véro\" loading=\"lazy\" />													\n			<h2>Véro</h2>		\n		<p>Frais &amp; fruité c’est parfait<br />pour accompagner le goûter.</p>		\n													<img src=\"http://planty.local/wp-content/uploads/elementor/thumbs/Marc-1-qllkp4qsqv5ogj9ypvzcwep9ooorj0qk1knsaqbram.jpg\" title=\"Marc\" alt=\"Marc\" loading=\"lazy\" />													\n			<h2>Marc</h2>		\n		<p>Un boost d’énergie sans<br />produits chimiques, un vrai plus dans ma journée.</p>		\n													<img width=\"800\" height=\"90\" src=\"http://planty.local/wp-content/uploads/2024/03/Canettegroup-1024x115.png\" alt=\"Canettes\" srcset=\"http://planty.local/wp-content/uploads/2024/03/Canettegroup-1024x115.png 1024w, http://planty.local/wp-content/uploads/2024/03/Canettegroup-300x34.png 300w, http://planty.local/wp-content/uploads/2024/03/Canettegroup-768x87.png 768w, http://planty.local/wp-content/uploads/2024/03/Canettegroup.png 1438w\" sizes=\"(max-width: 800px) 100vw, 800px\" />','HOME',' Planty, c’est la première boisson\nénergisante composée à 100 % de produits naturels. \nAvec son goût frais et fruité, retrouvez votre \nénergie grâce aux plantes riches en vitamine B2, \nà n’importe quel moment de la journée.','publish','closed','closed','','home','','','2024-04-04 19:06:32','2024-04-04 17:06:32','',0,'http://planty.local/?page_id=8',0,'page','',0);
