INSERT INTO `wp_posts` VALUES (8254,1,'2024-04-06 14:06:32','2024-04-06 12:06:32','<style>/*! elementor - v3.20.0 - 26-03-2024 */\n.elementor-heading-title{padding:0;margin:0;line-height:1}.elementor-widget-heading .elementor-heading-title[class*=elementor-size-]>a{color:inherit;font-size:inherit;line-height:inherit}.elementor-widget-heading .elementor-heading-title.elementor-size-small{font-size:15px}.elementor-widget-heading .elementor-heading-title.elementor-size-medium{font-size:19px}.elementor-widget-heading .elementor-heading-title.elementor-size-large{font-size:29px}.elementor-widget-heading .elementor-heading-title.elementor-size-xl{font-size:39px}.elementor-widget-heading .elementor-heading-title.elementor-size-xxl{font-size:59px}</style><h2>NOUS RENCONTRER</h2>		\n		<p>Chez Planty nous sommes tous passionnés par le bien-être, et ça se retrouve dans nos boissons ! Notre start-up s’est construite au fur et à mesure de rencontres entre amoureux des plantes.</p>		\n			<style>/*! elementor - v3.20.0 - 26-03-2024 */\n.elementor-widget-image{text-align:center}.elementor-widget-image a{display:inline-block}.elementor-widget-image a img[src$=\".svg\"]{width:48px}.elementor-widget-image img{vertical-align:middle;display:inline-block}</style>										<img src=\"http://planty.local/wp-content/uploads/elementor/thumbs/Fleur-qllkp4qsjujsyq6mgry6a2f4osxrn2gqw7hj5gxeke.png\" title=\"Fleur\" alt=\"Fleur\" loading=\"lazy\" />													\n			<h2>L\'équipe</h2>		\n													<img src=\"http://planty.local/wp-content/uploads/elementor/thumbs/Megane-1-qllkp4qt8ugjk5rmyr3x22rp270l42p5bgfdvnquio.jpg\" title=\"Mégane\" alt=\"Mégane\" loading=\"lazy\" />													\n													<img src=\"http://planty.local/wp-content/uploads/elementor/thumbs/Brooke-1-qllkp4qt8ugjk5rmyr3x22rp270l42p5bgfdvnquio.jpg\" title=\"Brooke\" alt=\"Brooke\" loading=\"lazy\" />													\n													<img src=\"http://planty.local/wp-content/uploads/elementor/thumbs/Sylvie-1-qllkp4qt8ugjk5rmyr3x2